import React, { useContext, useState } from "react";
import { useLocation } from "react-router-dom";
import AuthContext from "../../Auth/AuthContext";
import "./Dashboard.scss";
import Artists from "../Artists/Artists";
import Tracks from "../Tracks/Tracks";
import Genres from "../Genres/Genres";
import RecentlyPlayed from "../RecentlyPlayed/RecentlyPlayed";
import Header from "../Header/Header";
import Playlist from "../Playlist/Playlist";
import Mood from "../Mood/Mood";
import "./Header.scss";
import Settings from "../Settings/Settings";
import { Link } from "react-router-dom";
import HeaderLogo from "../../assets/images/sound-waves.png";
import ExpandArrow from "../../assets/images/Expand_Arrow.png";

import { Routes, Route } from "react-router-dom";

function Dashboard() {
  const { accessToken } = useContext(AuthContext);
  const [selectedTimeRange, setSelectedTimeRange] = useState("short_term");
  const location = useLocation();

  const showButtons =
    location.pathname.includes("/artists") ||
    location.pathname.includes("/tracks") ||
    location.pathname.includes("/genres");

  return (
    <div className="dashboard">
      <Header />

      {showButtons && (
        <section className="dashboard__hero">
          <ul className="header__nav">

          <li className="header__nav--list" onClick={toggleDropdown}>
          <div className="header__nav--container">
            Stats <img className="header__nav--icon" src={ExpandArrow} alt="expand arrow" />
            </div>

            {isDropdownVisible && (
              <ul className="header__dropdown">
                <Link to="/dashboard/tracks">
                  <li className="header__dropdown--item">Top Tracks</li>
                </Link>
                <Link to="/dashboard/artists">
                  <li className="header__dropdown--item">Top Artists</li>
                </Link>
                <Link to="/dashboard/genres">
                  <li className="header__dropdown--item">Top Genres</li>
                </Link>
                <Link to="/dashboard/recent">
                  <li className="header__dropdown--item">Recently Played</li>
                </Link>
              </ul>
            )}
          </li>
          <Link to="/dashboard/mood">
          <li className="header__nav--list">Your Mood</li>
          </Link>
          <Link to="/dashboard/playlist">
            <li className="header__nav--list">Create a Playlist</li>
          </Link>
          <Settings />
        </ul>
          <button
            className="dashboard__btn"
            onClick={() => setSelectedTimeRange("short_term")}
          >
            Past 4 weeks
          </button>
          <button
            className="dashboard__btn"
            onClick={() => setSelectedTimeRange("medium_term")}
          >
            Past 6 months
          </button>
          <button
            className="dashboard__btn"
            onClick={() => setSelectedTimeRange("long_term")}
          >
            All time
          </button>
        </section>
      )}

      <div className="dashboard__top">
        <Routes>
          <Route
            path="artists"
            element={
              <Artists
                selectedTimeRange={selectedTimeRange}
                accessToken={accessToken}
              />
            }
          />
          <Route
            path="tracks"
            element={
              <Tracks
                selectedTimeRange={selectedTimeRange}
                accessToken={accessToken}
              />
            }
          />
          <Route
            path="genres"
            element={
              <Genres
                selectedTimeRange={selectedTimeRange}
                accessToken={accessToken}
              />
            }
          />
          <Route
            path="recent"
            element={<RecentlyPlayed accessToken={accessToken} />}
          />
          <Route
            path="playlist"
            element={<Playlist accessToken={accessToken} />}
          />
          <Route path="mood" element={<Mood accessToken={accessToken} />} />
        </Routes>
      </div>
    </div>
  );
}

export default Dashboard;
